pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

interface IFlagsStorage {

    /**
    * @dev Emitted when DAO Controller is updated from `prevDAOController` to `daoController`.
    */
    event DAOControllerUpdated(
        address indexed prevDAOController,
        address indexed daoController
    );

    /**
    * @dev Emitted when new flag is added with `flag` short code and `index`.
    */
    event FlagAdded(bytes32 indexed flag, uint8 index);

    /**
    * @dev Emitted when existing flag is removed from FlagsStorage by `flag` short code.
    */
    event FlagRemoved(bytes32 indexed flag);

    /**
    * @dev Triggers to add new flag into gateway token system
    * @param _flag Flag short identifier
    * @param _index Flag index (limited to 255)
    * @notice Only executed by existing DAO Manager
    */
    function addFlag(bytes32 _flag, uint8 _index) external;

    /**
    * @dev Triggers to add multiple flags into gateway token system
    * @param _flags Array of flag short identifiers
    * @param _indexes Array of flag indexes (limited to 255)
    * @notice Only executed by existing DAO Manager
    */
    function addFlags(bytes32[] memory _flags, uint8[] memory _indexes) external;

    /**
    * @dev Triggers to get DAO Controller address
    */
    function daoController() external view returns (address);

    /**
    * @dev Triggers to get flag index from flags mapping
    */
    function flagIndexes(bytes32) external view returns (uint8);

    /**
    * @dev Triggers to check if a particular flag is supported
    * @param _flag Flag short identifier
    * @return Boolean for flag support
    */
    function isFlagSupported(bytes32 _flag) external view returns (bool);

    /**
    * @dev Triggers to check if several flags are supported
    * @param _flags Array of flags
    * @return Array of booleans with support per flag
    */
    function isFlagsSupported(bytes32[] memory _flags)
        external
        view
        returns (bool[] memory);

    /**
    * @dev Triggers to remove existing flag from gateway token system
    * @param _flag Flag short identifier
    * @notice Only executed by existing DAO Manager
    */
    function removeFlag(bytes32 _flag) external;

    /**
    * @dev Triggers to remove multiple existing flags from gateway token system
    * @param _flags Array of flag short identifiers
    * @notice Only executed by existing DAO Manager
    */
    function removeFlags(bytes32[] memory _flags) external;

    /**
    * @dev Triggers to get bitmask of all supported flags
    */
    function supportedFlagsMask() external view returns (uint256);

    /**
    * @dev Triggers to get bitmask of all unsupported flags
    */
    function unsupportedFlagsMask() external view returns (uint256);

    /**
    * @dev Triggers to transfer ownership of this contract to new DAO Controller, reverts on zero address and wallet addresses
    * @param _newDAOController New DAO Controller contract address
    * @notice Only executed by existing DAO Manager
    */
    function updateDAOManager(address _newDAOController) external;
}","keccak256":"0x117dbad139abc1d34620105fc8b2f29e9be3b4bb3e821c5fc04c0bce5300b338","license":"MIT"},"contracts/interfaces/IGatewayToken.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IGatewayToken {
    /**
    * @dev Emitted when GatewayToken allowed to transfer for token owners by `account`.
    */
    event TransfersAccepted(address account);

    /**
    * @dev Emitted when GatewayToken restricted to transfer for token owners by `account`.
    */
    event TransfersRestricted(address account);

    /**
    * @dev Emitted when GatewayToken DAO Manager transfered to `newDAOManager` address.
    */
    event DAOManagerTransfered(address previousDAOManager, address newDAOManager);

    /**
    * @dev Triggers to get all information relating to gateway `tokenId`
    * @param tokenId Gateway token id
    */
    function getToken(uint256 tokenId) 
        external 
        view  
        returns (
            address owner,
            uint8 state,
            string memory identity,
            uint256 expiration,
            uint256 bitmask
        );

    /**
    * @dev Triggers to get gateway token state with specified `tokenId`
    * @param tokenId Gateway token id
    */
    function getTokenState(uint256 tokenId) external view virtual returns (uint8 state);

    /**
    * @dev Triggers to get default gateway token ID for `owner`
    * @param owner Token owner address
    */
    function getTokenId(address owner) external returns (uint256);

    /**
    * @dev Triggers to set token with specified `tokenId` as default for `owner`
    * @param owner  Token owner address
    * @param tokenId Gateway token id
    */
    function setDefaultTokenId(address owner, uint256 tokenId) external;

    /**
    * @dev Triggers to verify if address has a GATEKEEPER role. 
    * @param gatekeeper Gatekeeper address
    */
    function isGatekeeper(address gatekeeper) external returns (bool);

    /**
    * @dev Triggers to add new network authority into the system. 
    * @param authority Network Authority address
    *
    * @notice Only triggered by Identity.com Admin
    */
    function addNetworkAuthority(address authority) external;

    /**
    * @dev Triggers to remove existing network authority from gateway token. 
    * @param authority Network Authority address
    *
    * @notice Only triggered by Identity.com Admin
    */
    function removeNetworkAuthority(address authority) external;

    /**
    * @dev Triggers to verify if authority has a NETWORK_AUTHORITY_ROLE role. 
    * @param authority Network Authority address
    */
    function isNetworkAuthority(address authority) external returns (bool);

    /**
    * @dev Triggers to allow token transfers by token owners. 
    *
    * @notice Only triggered by Identity.com Admin
    */
    function allowTransfers() external returns (bool);

    /**
    * @dev Triggers to stop token transfers by token owners. 
    *
    * @notice Only triggered by Identity.com Admin
    */
    function stopTransfers() external returns (bool);

    /**
    * @dev Triggers to check if token governed by DAO. 
    */
    function isDAOGoverned() external returns (bool);

    /**
    * @dev Triggers to get DAO Manager address. 
    */
    function daoManager() external returns (address);

    /**
    * @dev Transfers Gateway Token DAO Manager access from daoManager to `newManager`
    * @param newManager Address to transfer DAO Manager role for.
    */
    function transferDAOManager(address newManager) external;
}","keccak256":"0xe39ec70854a13ebf9fa745e9775bb3f09c3e8bdb7ab8a9fa6412eeec72f8f6b5","license":"MIT"},"contracts/interfaces/IGatewayTokenController.sol":{"content":"// SPDX-License-Identifier: MIT
